    const [showLogin, setShowLogin] = useState(false);
    const [showSignUpForm, setShowSignUpForm] = useState(false);

    if (showSignUpForm) {
        return <SignUpForm/>;
    } else if (showLogin) {
        return <Login/>;
    } else {
        return (<div>
            <h1>Sign Up</h1>
            <h4>Already a member? <button onClick={() => setShowLogin(true)}>Log In</button></h4>
